INSERT INTO DOMS_ACCRUAL_BASIS(DOMAIN, DOMAIN_DESC) VALUES ('BDS-252', 'Business day based (252 BD per year). A calendar code must be declared for the uderlying curve.');
INSERT INTO DOMS_ACCRUAL_BASIS(DOMAIN, DOMAIN_DESC) VALUES ('ACT-360', 'The accrual factor is the actual number of accrued days divided by 360. This is used in money markets and to calculate the accrued interest for Bonds and Swaps.');
INSERT INTO DOMS_ACCRUAL_BASIS(DOMAIN, DOMAIN_DESC) VALUES ('ACT-365', 'The accrual factor is the actual number of accrued days divided by 365.');
INSERT INTO DOMS_ACCRUAL_BASIS(DOMAIN, DOMAIN_DESC) VALUES ('30E-360', '30/360 European. If the first date or the last date of an accrual period is on the 31st of a month, then the date is set to 30th. The accrual factor is then the number of accrual days divided by 360.');
INSERT INTO DOMS_ACCRUAL_BASIS(DOMAIN, DOMAIN_DESC) VALUES ('ACT-ACT', 'Actual/Actual. If the period is less than one year, the accrual factor is equal to the actual number of days between two dates divided by the number of days in the period from end date - 1year to the end date (either 365 or 366). If the period is greater then one year, then the accrual factor is equal to the number of whole years plus the accrual of a stub period calculated as previously described.');
INSERT INTO DOMS_ACCRUAL_BASIS(DOMAIN, DOMAIN_DESC) VALUES ('30S-360', 'Standard 30/360. Considers that there  are 30 days per month and 360 per year. However, if the first date of an accrual period is not the 30th or 31st, and the last date of the period is the 31st of the month, then that month is considered to have 31 days. The accrual factor is then the number of accrued days divided by 360.');
INSERT INTO DOMS_ACCRUAL_BASIS(DOMAIN, DOMAIN_DESC) VALUES ('NON-NON', 'Not Accrued Rate/Index');
INSERT INTO DOMS_DISCOUNT_METHOD(DOMAIN, DOMAIN_DESC) VALUES ('DLS', 'Deal Level spread');
