INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('11', 'Exposicao - Contabil -Exposicoes registradas nos 5 niveis do Cosif, em contas do ativo, do passivo ou da compensacao. Representativos de exposicoes a serem detalhadas com a indicacao de contas.', '2015-10-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('21', 'Exposicao - Nao Contabil - Exposicoes sem registro correspondente nos 5 niveis do Cosif: alguns derivativos, exposicoes de fundos alavancados, alguns creditos a liberar, operacoes a liquidar e  limites de credito que nao tenham contas Cosif especificas para seu registro.', '2015-10-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('31', 'Nao Exposicao por Disposicao Normativa - Operacoes interdependencia e as demais operacoes realizadas com instituicoes que integrem o conglomerado prudencial – inciso III do par. 2 do art. 3 da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17.', '2015-10-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('32', 'Exposicao Excluida do RWA - Elementos patrimoniais deduzidos do PR, inclusive creditos tributarios compensados, e operacoes realizadas com base em destaque de capital previsto na Res. 2.827/01 – inciso II do art. 33 da Circ. 3.644/13.', '2015-10-01', '2016-12-01');
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('33', 'Nao Exposicao por Disposicao Normativa - Aplicacoes em acoes e mercadorias (commodities) cobertas pela parcela relativa as exposicoes ao risco de mercado sujeitas ao calculo do requerimento de capital mediante abordagem padronizada (RWAMPAD) ou modelo interno autorizado pelo Banco Central do Brasil (RWAMINT) do montante RWA, de que trata a Resolucao 4.193/13  – inciso V do par. 2 do art. 3 da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17.', '2015-10-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('34', 'Nao Exposicao por Disposicao Normativa - Operacoes com derivativos realizadas em mercado de balcao em que a instituicao atue exclusivamente com intermediaria, nao assumindo direitos ou obrigacoes decorrentes da oscilacao do valor de reposicao ou do inadimplemento de qualquer das partes – inciso VI do par. 2 do art. 3 da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17. ', '2015-10-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('35', 'Nao Exposicao por Disposicao Normativa - Cheques, boletos, documentos de credito (DOC s) e outros instrumentos de pagamento a serem creditados em contas de clientes, quando a liberacao dos recursos estiver vinculada a efetiva compensacao, nos termos da regulamentacao em vigor – inciso VII do par. 2 do art. 3 da Circ. 3.644/13, com redacao dada pela Circ. 3.921/18.', '2015-10-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('36', 'Nao Exposicao por Disposicao Normativa - Operacoes ativas vinculadas – inciso VIII do par. 2 do art. 3 da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17. ', '2015-10-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('37', 'Nao Exposicao por Disposicao Normativa - Elementos patrimoniais deduzidos na apuracao do PR, conforme definido nos arts. 5 a 8-B da Resolucao 4.192/13, brutos dos passivos fiscais diferidos a eles associados subtraidos para fins do calculo do PR - inciso IV do par. 2 do art. 3 da Circ. 3.644/13.', '2017-01-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('38', 'Nao Exposicao por Disposicao Normativa - Obrigacoes fiscais diferidas compensadas na apuracao dos ajustes prudenciais, relacionados agios pagos na aquisicao de investimentos, ativos atuariais relacionados a fundos de pensao de beneficios definido e creditos tributarios – inciso IV do par. 2 do art. 3 da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17.', '2017-01-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('39', 'Nao Exposicao por Disposicao Normativa - Operacoes de credito com orgaos e entidades do setor publico referentes ao destaque de parcela do PR, nos termos do art. 2 da Resolucao 4.589/17 – Inciso X do par. 2 do art. 3 da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17. ', '2017-01-01', null);
