INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('45', 'Nao Exposicao por Disposicao Normativa - Parcela das operacoes de credito realizadas no âmbito do Programa Emergencial de Acesso a Credito na modalidade de garantia de recebiveis (Peac-Maquininhas), instituido pela Lei n 14.042, de 19 de agosto de 2020, a ser reembolsada a Uniao -  Inciso XII do par. 2 do art. 3 da Circ. 3.644/13.', '2020-09-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('41', 'Nao Exposicao por Disposicao Normativa - Coobrigacoes e demais modalidades de retencao de riscos e beneficios decorrentes de operacoes de venda ou de transferencia de ativos financeiros que permanecam registrados no ativo da instituicao, nos termos da regulamentacao em vigor – inciso I do par. 2 do art. 3 da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17. ', '2015-10-01', null);
INSERT INTO ALCM_DLO_TB24(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE) VALUES ('42', 'Nao Exposicao por Disposicao Normativa - Cotas de fundos e os titulos de securitizacao associados a operacoes de venda ou de transferencia de ativos financeiros que permanecam registrados no ativo da instituicao, nos termos da regulamentacao em vigor, na proporcao entre o montante dos ativos transferidos que permanecam registrados no ativo da instituicao e o valor total dos ativos do respectivofundo ou processo de securitizacao – inciso II do par. 2 do art. 3 da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17. ', '2015-10-01', null);
