INSERT INTO ALCM_DLO_TB12(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('16', '100% - Fator de Conversao em Credito (FCC) aplicavel a prestacao de aval, fianca, coobrigacao ou qualquer outra modalidade de garantia pessoal do cumprimento de obrigacao financeira de terceiros, nos demais casos - Art. 11, inciso III da Circ. 3.644/13, com redacao dada pela Circ. 3.714/14);', '2015-01-01', '2015-10-01', 100);
