INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('010', '0% - Exposicoes referentes a valores mantidos em especie na moeda local da jurisdicao, bem como exposicao a ativo objeto representado pela referida moeda, independentes da sua classificacao externa de risco, se cumpridas as seguintes condicoes: I) a captacao de recursos da instituicao seja realizada na moeda local na jurisdicao; e II) as exposicoes estejam registradas no balanco da subsidiaria sediada na mesma jurisicao.', '2020-04-01', null, 0);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('011', '2% - Exposicoes decorrentes de operacoes a serem liquidadas em sistemas de liquidacao de câmaras ou prestadores de servicos de compensacao e de liquidacao, nas quais uma entidade interponha-se como contraparte central, que atendam as seguintes caracteristicas: I - seja autorizada pelo Banco Central do Brasil, nos termos da Lei n 10.214, de 27 de marco de 2001, e regulamentacao em vigor.', '2015-01-01', '2017-01-31', 2);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('012', '2% - Exposicoes decorrentes de operacoes a serem liquidadas em sistemas de liquidacao de câmaras ou prestadores de servicos de compensacao e de liquidacao, nas quais uma entidade interponha-se como contraparte central, que atendam as seguintes caracteristicas:  II - esteja sujeita a regulamentacao consistente com os principios estabelecidos pelo Comite sobre Pagamentos e Infraestruturas do Mercado (CPMI) e pela Organizacao Internacional de Comissoes de Valores Mobiliarios (IOSCO). Cabe a instituicao documentos o atendimento.', '2015-01-01', '2017-01-31', 2);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('013', '2% - Exposicoes decorrentes de operacoes a serem liquidadas em sistemas de liquidacao de câmaras ou prestadores de servicos de compensacao e de liquidacao, nas quais uma entidade interponha-se como contraparte central, que atendam as seguintes caracteristicas: III – seja reconhecida como qualificada pelo Banco Central do Brasil, nos termos da Circular 3.772, de 1 de dezembro de 2015.', '2015-12-01', '2017-12-31', 2);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('014', '2% - Exposicoes decorrentes de operacoes de titularidade propria, de que trata o art. 3, incisos I e VIII, realizadas diretamente com uma QCCP, a serem liquidadas nos sistemas mencionados no art. 20.', '2018-01-01', null, 2);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('015', '2% - Exposicoes decorrentes de operacoes de titularidade propria, de que trata o art. 3, incisos I e VIII, realizadas com uma QCCP por meio de instituicao financeira nao integrante do conglomerado prudencial, se atendidos cumulativamente os seguintes requisitos: a) a operacao esta registrada na QCCP: 1 – em nome do titular da operacao; ou 2 – em nome do membro de compensacao, de forma segregada das operacoes proprias, no caso de multiplos clientes em uma unica operacao; b) os termos do contrato firmado entre as partes possibilitam a adocao das medidas e dos procedimentos necessarios para a tempestiva liquidacao ou transferencia dos ativos, incluindo eventuais garantias prestadas, na ocorrencia de liquidacao, falencia ou inadimplemento de qualquer entidade integrante da cadeia de responsabilidades entre o titular da operacao e a QCCP; c) o titular da operacao esta protegido de quaisquer perdas decorrentes de liquidacao, falencia ou inadimplemento: 1 – de qualquer entidade integrante da cadeia de responsabilidades entre ele e a QCCP; e 2 – dos demais clientes, no caso de multiplos clientes em uma unica operacao; e d) o contrato firmado entre as partes tem forca juridica em todos os foros relevantes, inclusive em outras jurisdicoes nas quais deva ou possa produzir efeitos.', '2018-01-01', null, 2);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('016', '4% - Exposicoes decorrentes de operacoes de titularidade propria, de que trata o art. 3, incisos I e VIII, realizadas com uma QCCP por meio de instituicao financeira nao integrante do conglomerado prudencial, se atendidos os requisitos de que tratam as alineas “a”, “b” e “d”, do inciso I do art. 20-C da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17.', '2018-01-01', null, 4);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('017', '50% - Exposicoes decorrentes de operacoes de titularidade propria, de que trata o art. 3, incisos I e VIII, realizadas com uma QCCP por meio de instituicao financeira nao integrante do conglomerado prudencial, atendidas as disposicoes dos incisos I e II do art. 20-C da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17, nos demais casos.', '2018-01-01', null, 50);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('115', '2% - Exposicao a contraparte central decorrente de operacoes compromissadas, de emprestimos de ativos ou de operacoes com instrumentso financeiros derivativos realizadas em nome de clientes, liquidadas em câmaras ou prestadores de servicos de compensacao e de liquidacao, nas quais a instituicao assume obrigacao contratual de reembolsar perdas decorrentes de insolvencia da contraparte central, caso a instituicao atue como membro de compensacao.', '2018-01-01', null, 2);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('116', '2% - Exposicao a contraparte central decorrente de operacoes compromissadas, de emprestimos de ativos ou de operacoes com instrumentso financeiros derivativos realizadas em nome de clientes, liquidadas em câmaras ou prestadores de servicos de compensacao e de liquidacao, nas quais a instituicao assume obrigacao contratual de reembolsar perdas decorrentes de insolvencia da contraparte central, atendidos os requisitos das alineas “a”, “b”, “c” e “d” do inciso I do art. 20-C, com redacao dada pela Circ. 3.849/17, quando efetuadas por meio de instituicao nao integrante do conglomerado prudencial.', '2018-01-01', null, 2);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('117', '4% - Exposicao a contraparte central decorrente de operacoes compromissadas, de emprestimos de ativos ou de operacoes com instrumentso financeiros derivativos realizadas em nome de clientes, liquidadas em câmaras ou prestadores de servicos de compensacao e de liquidacao, nas quais a instituicao assume obrigacao contratual de reembolsar perdas decorrentes de insolvencia da contraparte central, se atendidos os requisitos das alineas “a”, “b” e “d” do inciso I do art. 20-C, com redacao dada pela Circ. 3.849/17, quando efetuadas por meio de instituicao nao integrante do conglomerado prudencial.', '2018-01-01', null, 4);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('118', '50% - Exposicao a contraparte central decorrente de operacoes compromissadas, de emprestimos de ativos ou de operacoes com instrumentso financeiros derivativos realizadas em nome de clientes, liquidadas em câmaras ou prestadores de servicos de compensacao e de liquidacao, nas quais a instituicao assume obrigacao contratual de reembolsar perdas decorrentes de insolvencia da contraparte central, atendidas as disposicoes dos incisos I e II do art. 20-C da Circ. 3.644/13, com redacao dada pela Circ. 3.849/17, nos demais casos, quando efetuadas por meio de instituicao nao integrante do conglomerado prudencial.', '2018-01-01', null, 50);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('119', '0% - Exposicao ao cliente contratante junto a instituicao decorrente de operacoes compromissadas, de emprestimo de ativos ou de operacoes com instrumentos financeiros derivativos liquidadas em câmaras ou prestadores de servicos de compensacao e de liquidacao, nas quais uma entidade de interponha como contraparte central quando atendido ao disposto no art. 19 da Circ. 3.644/13.', '2018-01-01', null, 0);
