INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('042', '35% - Deve ser aplicado FPR de 35% (trinta e cinco por cento) as exposicoes relativas a financiamentos para aquisicao de imovel residencial, novo ou usado, garantidos por alienacao fiduciaria do imovel financiado, cujo valor contratado seja de ate 80% (oitenta por cento) do valor de avaliacao da garantia, na data da concessao do credito.', '2015-01-01', '2015-01-31', 35);
