INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('036', '20% - Operacoes com o Novo Banco de Desenvolvimento (NBD), limites de credito  nao cancelaveis incondicional e unilateralmente pela instituicao, concedidos a referida EMD, bem como as garantias a ela prestadas e titulos e valores mobiliarios por ela emitidos.', '2020-04-01', null, 20);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('038', '35% - Exposicoes relativas a financiamentos para aquisicao de imovel residencial, novo ou usado, cujo valor do saldo devedor seja de ate 80% (oitenta por cento) do valor de avaliacao da garantia na data da concessao do credito, quando a operacao for garantida por alienacao fiduciaria do imovel financiado, se localizado no Brasil. No caso de multiplas exposicoes garantidas pelo mesmo imovel, o valor do saldo devedor deve considerar a soma dos respectivos valores devidos.', '2017-06-01', null, 35);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('138', '35% - Exposicoes relativas a financiamentos para aquisicao de imovel residencial, novo ou usado, cujo valor do saldo devedor seja de ate 80% (oitenta por cento) do valor de avaliacao da garantia na data da concessao do credito, quando a operacao for garantida por hipoteca em primeiro grau, se o imovel estiver localizado em jurisdicao com a caracteristica mencionada no art. 21, inciso II da Circ. 3.644/13, desde que o prazo medio efetivo de retomada da garantia, de acordo com a pratica observada na jurisidicao, seja inferior a 24 meses.  No caso de multiplas exposicoes garantidas pelo mesmo imovel, o valor do saldo devedor deve considerar a soma dos respectivos valores devidos.  No caso de multiplas exposicoes garantidas pelo mesmo imovel, o valor do saldo devedor deve considerar a soma dos respectivos valores devidos.', '2019-08-01', null, 35);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('039', '35% - Emprestimos concedidos a pessoal natural garantidos por imovel residencial, novo ou usado, cujo valor do saldo devedor seja de ate 50% (cinquenta por cento) do valor de avaliacao da garantia na data da concessao do credito, quando a operacao for garantida por alienacao fiduciaria do imovel, se localizado no Brasil. No caso de multiplas exposicoes garantidas pelo mesmo imovel, o valor do saldo devedor deve considerar a soma dos respectivos valores devidos.', '2017-06-01', null, 35);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('139', '35% - Emprestimos concedidos a pessoal natural garantidos por imovel residencial, novo ou usado, cujo valor do saldo devedor seja de ate 50% (cinquenta por cento) do valor de avaliacao da garantia na data da concessao do credito, quando a operacao for garantida hipoteca em primeiro grau, se o imovel estiver localizado em jurisdicao com a caracteristica mencionada no art. 21, inciso II da Circ. 3.644/13, desde que o prazo medio efetivo de retomada da garantia, de acordo com a pratica observada na jurisidicao, seja inferior a 24 meses. No caso de multiplas exposicoes garantidas pelo mesmo imovel, o valor do saldo devedor deve considerar a soma dos respectivos valores devidos.', '2019-08-01', null, 35);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('043', '35% - Deve ser aplicado FPR de 35% (trinta e cinco por cento) as exposicoes relativas a financiamentos para aquisicao de imovel residencial, novo ou usado, cujo valor contratado seja de ate 80% (oitenta por cento) do valor de avaliacao da garantia na data da concessao do credito, quando a operacao for garantida por alienacao fiduciaria do imovel financiado, se localizado no Brasil. Este codigo somente podera ser utilizado para operacoes contratadas ate 31.5.2017, conforme par. 5 do art. 22 da Circular 3.644/2013, com redacao dada pela Circular 3.834/2017.', '2015-11-01', null, 35);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('044', '35% - Deve ser aplicado FPR de 35% (trinta e cinco por cento) as exposicoes relativas a financiamentos para aquisicao de imovel residencial, novo ou usado, cujo valor do saldo devedor for de ate 80% (oitenta por cento) do valor de avaliacao da garantia na data da concessao do credito, quando a operacao for garantida por hipoteca em primeiro grau, se o imovel for localizado em jurisdicao com a caracterisitica mencionada no art. 21, inciso II, desde que o prazo medio eftivo de retomada da garantia, de acordo com a pratica observada no jurisdicao, seja inferior a 24 (vinte e quatro) meses. Este codigo somente podera ser utilizado para operacoes contratadas ate 31.5.2017, conforme par. 5 do art. 22 da Circular 3.644/2013, com redacao dada pela Circular 3.834/2017.', '2015-11-01', null, 35);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('047', '35% - Podem receber o FPR de 35% (trinta e cinco por cento) as exposicoes relativas a financiamentos para aquisicao de imovel residencial, novo ou usado, garantidas por alienacao fiduciaria do imovel financiado, se localizado no Brasil, quando o saldo devedor for de ate 80% (oitenta por cento) do valor de avaliacao da garantia na data da concessao do credito e o valor atual da garantia nao for menor do que o valor de avaliacao da garantia na data da concessao. Este codigo somente podera ser utilizado para operacoes contratadas ate 31.5.2017, conforme par. 5 do art. 22 da Circular 3.644/2013, com redacao dada pela Circular 3.834/2017.', '2016-07-01', null, 35);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('048', '35% - Podem receber o FPR de 35% (trinta e cinco por cento) as exposicoes relativas a financiamentos para aquisicao de imovel residencial, novo ou usado, garantidas por hipoteca em primeiro grau, se o imovel for localizado nos paises de que trata o art. 19, inciso VII da Circ. 3.644/2013, com redacao dada pela Circ. 3.770/2015, desde que o prazo medio efetivo de retomada da garantia, no pais, seja inferior a 24 meses, quando o saldo devedor for de ate 80% (oitenta por cento) do valor de avaliacao da garantia na data da concessao do credito e o valor atual da garantia nao for menor do que o valor de avaliacao da garantia na data da concessao. Este codigo somente podera ser utilizado para operacoes contratadas ate 31.5.2017, conforme par. 5 do art. 22 da Circular 3.644/2013, com redacao dada pela Circular 3.834/2017.', '2016-07-01', null, 35);
