INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('146', '50% - Operacoes de credito a serem amortizadas com base nos recursos da Conta de Desenvolvimento Energetico (CDE), conforme previsto no inciso XV do art. 13 da Lei n 10.438, de 26 de abril de 2002, incluido pela Medida Provisoria n 950, de 8 de abril de 2020, desde que atendidas, cumulativamente, as seguintes condicoes: a) as operacoes de credito devem estar em conformidade com as disposicoes previstas no Decreto n 10.350, de 18 de maio de 2020, e na regulacao da Agencia Nacional de Energia Eletrica; b) os direitos creditorios devidos pela CDE a Conta-covid devem ser cedidos fiduciariamente ou empenhados em favor da instituicao credora; e c) as quotas da CDE, especificas para a amortizacao das operacoes de credito, devem ser majoradas para a constituicao de reserva de liquidez equivalente a no minimo 10% (dez por cento) da soma do principal, encargos financeiros e demais custos administrativos relacionados a operacao.', '2020-06-01', null, 50);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('141', '60% - Exposicoes relativas as exposicoes garantidas por imovel rural ou urbano nao residencial quando: I – o valor do saldo devedor for de ate 60% do valor de avaliacao da garantia na data da concessao do credito; II – a garantia for constituida por meio de alienacao fiduciaria ou hitpoteca em primeiro grau; e III – a geracao de fluxo de caixa pelo imovel nao for materialmente determinante para o cumprimento da obrigacao financeira. No caso de multiplas exposicoes garantidas pelo mesmo imovel, o item I deve considerar a soma dos saldos devedores.', '2019-06-01', null, 60);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('142', '70% - Exposicoes relativas aos financiamentos rurais formalizados com base na legislacao e na regulamentacao aplicavel ao credito rural garantidas por imovel rural ou urbano nao residencial quando: I – o valor do saldo devedor for de ate 60% do valor de avaliacao da garantia na data da concessao do credito; II – a garantia for constituida por meio de alienacao fiduciaria ou hitpoteca em primeiro grau; e No caso de multiplas exposicoes garantidas pelo mesmo imovel, o item I deve considerar a soma dos saldos devedores.', '2019-06-01', null, 70);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('071', '75% - Exposicoes de varejo. Consideram-se de varejo as operacoes que apresentem as seguintes caracteristicas, cumulativamente: I - tenham como contraparte, pessoa natural ou pessoa juridica de direito privado de pequeno porte;  II - assumam a forma de instrumento financeiro destinado as contrapartes citadas acima, com excecao de titulos e valores mobiliarios; III - apresentem somatorio das exposicoes correntes com uma mesma contraparte inferior a 0,2% (dois decimos por cento) do montante das exposicoes de varejo; IV -  apresentem somatorio das exposicoes correntes com uma mesma contraparte inferior a R$600.000,00 (seiscentos mil reais). No tocante as condicoes III e IV nao se deve aplicar a aplicacao de fatores de conversao em credito e nem a deducao das respectivas provisoes, bem como devem ser desconsiderados os valores de financiamentos para aquisicao de imovel residencial, novo ou usado, garantidos por alienacao fiduciaria ou hipoteca do imovel financiado. Para a definicao de unica contraparte, considera-se qualquer pessoa, natural ou juridica, ou grupo de pessoas agindo isoladamente ou em conjunto, representando interesse economico comum; e para a definicao de pequeno porte - a contraparte com receita bruta anual inferior a R$3.600.000,00 (tres milhoes e seiscentos mil reais). Nao deve ser aplicado FPR de 75% para as exposicoes para as quais haja FPR especifico estabelecido.', '2015-01-01', '2016-01-30', 75);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('072', '75% - Exposicoes de varejo no Brasil. Consideram-se de varejo as operacoes que apresentem as seguintes caracteristicas, cumulativamente: I - tenham como contraparte pessoa juridica de direito privado com receita anual inferior a R$15.000.000,00 (quinze milhoes de reais) ou pessoa natural;  II - assumam a forma de instrumento financeiro destinado as contrapartes citadas acima; III - apresentem somatorio das exposicoes correntes com uma mesma contraparte inferior a 0,2% (dois decimos por cento) do montante das exposicoes de varejo; IV -  apresentem somatorio das exposicoes correntes com uma mesma contraparte inferior a R$3.000.000,00 (tres milhoes de reais). No tocante as condicoes III e IV nao incide a aplicacao de fatores de conversao em credito e nem a deducao das respectivas provisoes, bem como devem ser desconsiderados os valores de financiamentos para aquisicao de imovel residencial, novo ou usado, garantidos por alienacao fiduciaria ou hipoteca do imovel financiado que recebam FPR de 35% ou de 50%. Para a definicao de unica contraparte, considera-se a pessoa, natural ou juridica, ou as contrapartes conectadas na forma definida na Resolucao 4.557/17, desde que o somatorio de que trata o par. 1, inciso IV do art. 24 da Circ. 3.644/17, sejam atendidos individual e conjuntamente. Nao deve ser aplicado FPR de 75% para as exposicoes em operacoes compromissadas, de emprestimo de ativos ou outras relacionadas com titulos e valores mobiliarios ou com instrumentos financeiros derivativos e para as quais haja FPR especifico estabelecido.', '2016-07-01', null, 75);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('073', '75% - Exposicoes de varejo no exterior. Consideram-se de varejo as operacoes que apresentem as seguintes caracteristicas, cumulativamente: I - tenham como contraparte pessoa juridica de direito privado com receita anual inferior a R$15.000.000,00 (quinze milhoes de reais) ou pessoa natural;  II - assumam a forma de instrumento financeiro destinado as contrapartes citadas acima; III - apresentem somatorio das exposicoes correntes com uma mesma contraparte inferior a 0,2% (dois decimos por cento) do montante das exposicoes de varejo; IV -  apresentem somatorio das exposicoes correntes com uma mesma contraparte inferior a R$3.000.000,00 (tres milhoes de reais). No tocante as condicoes III e IV nao incide a aplicacao de fatores de conversao em credito e nem a deducao das respectivas provisoes, bem como devem ser desconsiderados os valores de financiamentos para aquisicao de imovel residencial, novo ou usado, garantidos por alienacao fiduciaria ou hipoteca do imovel financiado que recebam FPR de 35% ou de 50%. Para a definicao de unica contraparte, considera-se a pessoa, natural ou juridica, ou as contrapartes conectadas na forma definida na Resolucao 4.557/17, desde que o somatorio de que trata o par. 1, inciso IV do art. 24 da Circ. 3.644/17, sejam atendidos individual e conjuntamente. Nao deve ser aplicado FPR de 75% para as exposicoes em operacoes compromissadas, de emprestimo de ativos ou outras relacionadas com titulos e valores mobiliarios ou com instrumentos financeiros derivativos e para as quais haja FPR especifico estabelecido.', '2016-07-01', null, 75);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('081', '85% - Exposicoes decorrentes de operacoes em que: I - a contraparte seja pessoa juridica cujo somatorio do saldo de operacoes registradas no Sistema de Informacoes de Credito do Banco Central (SCR) seja superior a R$100.000.000,00 (cem milhoes de reais); e II - o saldo das operacoes de credito contratadas pela instituicao financeira com a pessoa juridica referida no inciso I corresponda a um montante inferior a 10% (dez por cento) do Patrimonio de Referencia (PR) da instituicao, conforme definido na Resolucao n 4.192, de 2013.', '2015-01-01', '2016-01-30', 85);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('082', '85% - Exposicoes, no Brasil, decorrentes de operacoes com contraparte pessoa juridica que apresente cumulativamente: I – demonstracoes contabeis, relativas ao exercicio social mais recente disponivel, auditadas por auditor independetente registrado na Comissao de Valores Mobiliarios ou em autoridade equivalente ou superior; II – ativo total superior a R$240.000.000,00 (duentos e quarenta milhoes de reais) ou receita burta anual superior a R$300.000.000,00 (trezentos milhoes de reais) no exercicio social mais recente disponivel; III – nenhuma exposicao caracterizada como ativo problematico na instituicao, nos termos do art. 24 da Resolucao 4.557/2017; e IV – indice de descumprimento (ID) no SCR inferior ou igual a 0,05% (cinco centesimos por cento), aferido de acordo com a formula constante do inciso IV do art. 24-A do Circ. 3.644/2017, com redacao dada plea Circ. 3.921/2018. Os somatorios mencionados na formula contemplas as informacoes disponiveis no SCR relativas aos seis meses imediatamente anteriores ao mes de apuracao do RWACPAD.  Devem ser consideradas como unica contraparte as pessoas juridicas que compartilhem o risco de credito perante a instituicao por meio de relacao de controle, nos termos no art. 22, par.2 da Resolucao 4.557/2017.', '2016-07-01', null, 85);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('083', '85% - Exposicoes, no exterior, decorrentes de operacoes com contraparte pessoa juridica que apresente cumulativamente: I – demonstracoes contabeis, relativas ao exercicio social mais recente disponivel, auditadas por auditor independetente registrado na Comissao de Valores Mobiliarios ou em autoridade equivalente ou superior; II – ativo total superior a R$240.000.000,00 (duentos e quarenta milhoes de reais) ou receita burta anual superior a R$300.000.000,00 (trezentos milhoes de reais) no exercicio social mais recente disponivel; III – nenhuma exposicao caracterizada como ativo problematico na instituicao, nos termos do art. 24 da Resolucao 4.557/2017; e IV – indice de descumprimento (ID) no SCR inferior ou igual a 0,05% (cinco centesimos por cento), aferido de acordo com a formula constante do inciso IV do art. 24-A do Circ. 3.644/2017, com redacao dada plea Circ. 3.921/2018. Os somatorios mencionados na formula contemplas as informacoes disponiveis no SCR relativas aos seis meses imediatamente anteriores ao mes de apuracao do RWACPAD.  Devem ser consideradas como unica contraparte as pessoas juridicas que compartilhem o risco de credito perante a instituicao por meio de relacao de controle, nos termos no art. 22, par.2 da Resolucao 4.557/2017.', '2016-07-01', null, 85);
INSERT INTO ALCM_DLO_TB10(DLO_DOMAIN, DLO_DOMAIN_DESCRIPTION, DLO_DOMAIN_INITIAL_DATE, DLO_DOMAIN_END_DATE, DLO_DOMAIN_PERCENTAGE) VALUES ('151', '85% - Exposicoes relativas a financiamentos ruraisformalizados com base na legislacao e regulamentacao aplicavel ao credito rural com contraparte pessoa juridica de direito privado que nao se enquadre nos criterios estabelecidos nos no art. 24 e no inciso II no art. 24-A da Circular 3.644/13.', '2019-06-01', null, 85);
